import { Link } from "react-router-dom";
export const Home = ({ trends }) => {
	return (
		<div>
			<h2>Trending today</h2>
			<div>
				{trends.map((product) => (
					<ul key={product.id}>
						<Link to={`${product.id}`}>
							<li>{product.title}</li>
						</Link>
					</ul>
				))}
			</div>
		</div>

	);
};
